@BillyM2k @BarrySilbert @UFMJA @ClayLambert20 @SatoshiLite The utility of $DOGE was twofold. 1) It made us laugh. 2) It gave people a way to acquire Bitcoin. 

Beyond that, Doge is just a joke and a way for traders to get some alpha on $BTC and $ETH. 

I like the joke. But in no way does Doge have the same utility or mission as #Bitcoin.
